import React from "react";
import CustomScrollbars from 'util/CustomScrollbars'

import DoctorListItem from "./DoctorListItem";

const DoctorList = ({doctors, onDoctorSelect, onDoctorChecked, onStartSelect}) => {
  return (
    <div className="gx-module-list gx-mail-list">
      <CustomScrollbars className="gx-module-content-scroll">
        {doctors.map((doctor, index) =>
          <DoctorListItem key={index} doctor={doctor} onDoctorSelect={onDoctorSelect} onDoctorChecked={onDoctorChecked}
                        onStartSelect={onStartSelect}/>
        )}
      </CustomScrollbars>
    </div>
  )
};

export default DoctorList;
